import React from "react";
import "./Header.css";

function Header() {

    return (
        <div class="header">
            <img src="https://raw.githubusercontent.com/bel-lloyd/my-files/master/Fundare%20Logo.svg"/>
            <h2>Do a dare or fund a dare to show you care.</h2>
        </div>
    );
}

export default Header;
